import React from 'react';
import { Provider } from "react-redux";
import store from "./store";
import HeaderComponent from "./compenents/header"

function App() {
  return (
    <Provider store={store}>
    <div className="App">
      <div className="font-bold text-center text-[23px] text-lime-300 ">
        <HeaderComponent/>
      </div>
      <div className="p-2 w-full max-w-screen-md ml-auto mr-auto h-full table-row">컨텐츠 컴포넌트 들어갈 공간</div>
    </div>
  </Provider>
  );
}

export default App;
